      out.write("			}\r\n");
      out.write("\r\n");
      out.write("			// 떨림 애니메이션\r\n");
      out.write("			function wobble(element) {\r\n");
      out.write("				let order = [0, -8, 8, -4, 4, -2, 2, -1, 1, 0];\r\n");
      out.write("				let seq = [];\r\n");
      out.write("				order.forEach(function (y) { seq.push({ transform: \"translate(0,\" + y + \"px)\" }); });\r\n");
      out.write("				element.animate(seq, { duration: 300 });\r\n");
      out.write("			}\r\n");
      out.write("\r\n");
      out.write("			// 유효성 검사 (공백 확인)\r\n");
      out.write("			function isFilled(elements) {\r\n");
      out.write("				for (i = 0; i < elements.length; i++) {\r\n");
      out.write("					if(elements[i].value == \"\") { \r\n");
      out.write("						wobble(elements[i]);\r\n");
      out.write("						elements[i].focus();\r\n");
      out.write("						return false; \r\n");
      out.write("					}\r\n");
      out.write("				}\r\n");
      out.write("				return true;\r\n");
      out.write("			}\r\n");
      out.write("\r\n");
      out.write("			// 로그인 함수\r\n");
      out.write("			function tryLogin() {\r\n");
