      out.write("							Swal.fire({ title: \"Success!\", icon: \"success\", text: \"로그인에 성공했습니다.\" })\r\n");
      out.write("								.then((result) => {\r\n");
      out.write("									if (result.isConfirmed) { location.reload(); }\r\n");
      out.write("								});\r\n");
      out.write("						} else {\r\n");
      out.write("							Swal.fire({ title: \"Error\", icon: \"error\", text: \"ID가 등록되지 않았거나 비밀번호가 올바르지 않습니다.\" });\r\n");
      out.write("						}\r\n");
      out.write("					});\r\n");
      out.write("			}\r\n");
      out.write("\r\n");
      out.write("			// 비밀번호 찾기 함수\r\n");
