      out.write("			// $(\"#loginModal\").on(\"click\", e => {\r\n");
      out.write("			// 	if (e.target.classList.contains(\"loginModal-overlay\")) { hideLoginModal(); }\r\n");
      out.write("			// });\r\n");
      out.write("\r\n");
      out.write("			// 버튼 이벤트\r\n");
