      out.write("\r\n");
      out.write("<script>\r\n");
      out.write("\r\n");
      out.write("        // 회원가입 signupModal 열기\r\n");
      out.write("        function showSignupModal() {\r\n");
      out.write("            $(\"#signupModal\").attr(\"style\", \"display:inline-flex\");\r\n");
      out.write("            $(\"#loginModal\").attr(\"style\", \"display:none\");\r\n");
      out.write("            toBackward();\r\n");
      out.write("        }\r\n");
      out.write("        \r\n");
      out.write("     	// 회원가입 signupModal 닫기\r\n");
      out.write("		function hideSignupModal() {\r\n");
      out.write("			$(\"#signupModal\").attr(\"style\", \"display:none\");\r\n");
      out.write("			\r\n");
      out.write("        	$(\"#users_email\").val(\"\");\r\n");
      out.write("        	$(\"#users_pw\").val(\"\");\r\n");
      out.write("        	$(\"#users_pw_re\").val(\"\");\r\n");
      out.write("        	$(\"#users_phone\").val(\"\");\r\n");
      out.write("        	\r\n");
      out.write("        	$(\"#users_email_msg\").css(\"display\", \"none\");\r\n");
      out.write("            $(\"#users_email_msg\").css(\"color\", \"#001A41\");\r\n");
