      out.write("\r\n");
      out.write("            $(\"#users_pw_re_msg\").css(\"display\", \"none\");\r\n");
      out.write("            $(\"#users_pw_re_msg\").css(\"color\", \"#001A41\");\r\n");
      out.write("            $(\"#users_pw_re_msg\").html(\"특수문자를 포함한 8~16자리 입력해주세요\");\r\n");
      out.write("            \r\n");
      out.write("            $(\"#users_phone_msg\").css(\"display\", \"none\");\r\n");
      out.write("            $(\"#users_phone_msg\").css(\"color\", \"#001A41\");\r\n");
