      out.write("            \r\n");
      out.write("            if ($(\"#users_email_msg\").css(\"color\") == \"rgb(255, 0, 0)\") { wobble($(\"#users_email\")[0]); $(\"#users_email\").focus(); }\r\n");
      out.write("            \r\n");
