      out.write("                if ($(\"#users_pw_re_msg\").html() == \"특수문자를 포함한 8~16자리 입력해주세요\") { wobble($(\"#users_pw\")[0]); $(\"#users_pw\").focus(); }\r\n");
      out.write("                else if ($(\"#users_pw_re_msg\").html() == \"동일한 비밀번호를 입력해주세요\") { wobble($(\"#users_pw_re\")[0]); $(\"#users_pw_re\").focus(); }\r\n");
