      out.write("\r\n");
      out.write("        // 유효성 검사 Regex\r\n");
      out.write("        let emailRegex = /^[a-zA-Z0-9+-\\_.]{1,20}@[a-zA-Z0-9-]{1,15}\\.[a-zA-Z-.]{1,12}$/;\r\n");
      out.write("        let pwRegex = /^(?=.*[A-Za-z\\d])(?=.*[~!@#$%^&*()+|=])[A-Za-z\\d~!@#$%^&*()+|=]{8,16}$/;\r\n");
      out.write("        let phoneRegex = /^0[\\d]{8,10}$/;\r\n");
      out.write("\r\n");
      out.write("        // input 칸에 숫자 외에 입력 안되게 막기\r\n");
      out.write("        function validNum() {\r\n");
      out.write("            event.target.value = event.target.value.replace(/[^0-9.]/g, '').replace(/(\\..*)\\./g, '$1');\r\n");
      out.write("        }\r\n");
      out.write("       \r\n");
      out.write("      \r\n");
      out.write("        // 이메일(아이디) - 아이디 중복검사 & 값 입력 유효성 검사 display\r\n");
      out.write("\r\n");
      out.write("        function idEvent() {\r\n");
      out.write("            if ($(\"#users_email\").val() == \"\") {\r\n");
      out.write("                $(\"#users_email_msg\").css(\"display\", \"block\");\r\n");
      out.write("                $(\"#users_email_msg\").css(\"color\", \"#001A41\");\r\n");
      out.write("                $(\"#users_email_msg\").html(\"이메일 형식을 아이디로 사용합니다\");\r\n");
      out.write("            } else if (!emailRegex.test($(\"#users_email\").val())) {\r\n");
      out.write("                $(\"#users_email_msg\").css(\"display\", \"block\");\r\n");
      out.write("                $(\"#users_email_msg\").css(\"color\", \"red\");\r\n");
      out.write("                $(\"#users_email_msg\").html(\"이메일 형식을 확인해주세요\");\r\n");
      out.write("            } else {\r\n");
      out.write("            	let email = $(\"#users_email\").val();\r\n");
      out.write("            	\r\n");
      out.write("            	$.ajax({\r\n");
      out.write("                    url: \"/duplCheck.user\",\r\n");
      out.write("                    data: { \"users_email\": email }\r\n");
      out.write("                }).done(function (resp) {\r\n");
      out.write("                	\r\n");
      out.write("                    console.log(resp);\r\n");
      out.write("                    if (resp == \"true\") { // 아이디가 이미 존재하므로 사용할 수 없는 경우\r\n");
      out.write("                        $(\"#users_email_msg\").css(\"display\", \"block\");\r\n");
      out.write("                        $(\"#users_email_msg\").css(\"color\", \"red\");\r\n");
      out.write("                        $(\"#users_email_msg\").html(\"이미 사용 중인 ID 입니다.\");\r\n");
      out.write("                    } else { // 아이디가 존재하지않으므로 사용할 수 있는 경우\r\n");
      out.write("                        $(\"#users_email_msg\").css(\"display\", \"block\");\r\n");
      out.write("                        $(\"#users_email_msg\").css(\"color\", \"#001A41\");\r\n");
      out.write("                        $(\"#users_email_msg\").html(\"사용 가능한 ID 입니다.\");\r\n");
      out.write("                    }\r\n");
      out.write("                });\r\n");
      out.write("            }\r\n");
      out.write("        }\r\n");
      out.write("        \r\n");
      out.write("        \r\n");
      out.write("\r\n");
      out.write("        $(\"#users_email\").on(\"focus\", function () {\r\n");
      out.write("            idEvent();\r\n");
      out.write("        })\r\n");
      out.write("\r\n");
      out.write("        $(\"#users_email\").on(\"keyup\", function () {\r\n");
      out.write("            idEvent();\r\n");
      out.write("        })\r\n");
      out.write("\r\n");
      out.write("        // 패스워드 - 값 입력 유효성 검사 display\r\n");
      out.write("\r\n");
      out.write("        function pwEvent() {\r\n");
      out.write("            if ($(\"#users_pw, #users_pw_re\").val() == \"\") {\r\n");
      out.write("                $(\"#users_pw_re_msg\").css(\"display\", \"block\");\r\n");
      out.write("                $(\"#users_pw_re_msg\").css(\"color\", \"#001A41\");\r\n");
      out.write("                $(\"#users_pw_re_msg\").html(\"특수문자를 포함한 8~16자리 입력해주세요\");\r\n");
      out.write("\r\n");
      out.write("            } else {\r\n");
      out.write("\r\n");
      out.write("                if (!pwRegex.test($(\"#users_pw\").val())) {\r\n");
      out.write("                    $(\"#users_pw_re_msg\").css(\"display\", \"block\");\r\n");
      out.write("                    $(\"#users_pw_re_msg\").css(\"color\", \"red\");\r\n");
      out.write("                    $(\"#users_pw_re_msg\").html(\"특수문자를 포함한 8~16자리 입력해주세요\");\r\n");
